import React from 'react';
import {Nav, Navbar} from 'react-bootstrap';
import styled from 'styled-components';


const Styles = styled.div`
    .navbar {
        background-color: #4542be;
        min-height: 100px;
        font-family: 'Montserrat', sans-serif;
    }

    .navbar-brand, .navbar-nav, .nav-link {
        color: white;
    }

    .navbar-brand {
        margin-left: 30px;
        font-size: 35px;
    }

    .nav-item .nav-link {
        font-size: 20px;
        color: white;
        margin-left: 8px;
        margin-right: 8px;
        text-align: center;
    }

    .navbar > a:hover {
        color:white;
    }

    .navbar .nav-item .nav-link > a:hover {
        color:white;
    }

    .navbar-toggle:link {
        margin-left: 10px;
    }
`;


export const NavBarCustom = () => (
    <Styles>
        <Navbar expand='lg'>
            <Navbar.Brand href = '/' >Po Shen Loh</Navbar.Brand>
            <Navbar.Toggle aria-controls="basic-navbar-nav"></Navbar.Toggle>
            <Navbar.Collapse id="basic-navbar-nav">
                <Nav className='ml-auto'>
                    <Nav.Item><Nav.Link href = "/">Home</Nav.Link></Nav.Item>
                    <Nav.Item><Nav.Link href = "/about">About</Nav.Link></Nav.Item>
                    <Nav.Item><Nav.Link href = "/about">News</Nav.Link></Nav.Item>
                    <Nav.Item><Nav.Link href = "/about">Events</Nav.Link></Nav.Item>
                    <Nav.Item><Nav.Link href = "/about">About</Nav.Link></Nav.Item>
                    <Nav.Item><Nav.Link href = "/about">Research</Nav.Link></Nav.Item>
                    <Nav.Item><Nav.Link href = "/about">Posts</Nav.Link></Nav.Item>
                    <Nav.Item><Nav.Link href = "/about">Contact</Nav.Link></Nav.Item>
                </Nav>
            </Navbar.Collapse>
        </Navbar>
    </Styles>
)
